-- Migration: Create postal_codes table and seed Spanish centroids
BEGIN;
CREATE TABLE IF NOT EXISTS postal_codes (
  country TEXT NOT NULL,
  postcode TEXT NOT NULL,
  lat DOUBLE PRECISION NOT NULL,
  lon DOUBLE PRECISION NOT NULL,
  PRIMARY KEY (country, postcode)
);
CREATE INDEX IF NOT EXISTS idx_postal_codes_postcode ON postal_codes (postcode);
-- Refresh Spanish centroids
DELETE FROM postal_codes WHERE country = 'ES';
ON CONFLICT (country, postcode) DO UPDATE SET
  lat = EXCLUDED.lat,
  lon = EXCLUDED.lon;
COMMIT;
